window.bookSummaryJSON = "<p><i>It Takes Two: Our Story</i> shares never-before-revealed tales of the Scott brothers' childhood and rise to fame - from starting their first business at seven years old and their years modeling and acting to their first house purchase at the impressive young age of 18. They soon found their true passion in life, combining their natural gifts for entertaining with the skills they learned from buying, renovating, and selling homes. </p> <p>Complete with hilarious behind-the-scenes stories from set, Jonathan and Drew discuss how their family and upbringing have led to their success in life. Throughout, the brothers keep fans laughing with the clever - and sometimes zany - sibling banter for which they're known best. </p>"; 
